/**
 * استخراج إحصائيات متقدمة للأحياء
 * @param {Object} data - بيانات الأحياء
 * @return {Object} إحصائيات مختلفة عن الأحياء
 */
function getAdvancedStatistics(data) {
  // تحليل مؤشر التنمية للأحياء
  const features = data.features;
  
  // استخراج إحصائيات حول الأضرار
  const damageStats = features.reduce((stats, feature) => {
    const damage = feature.properties.damage_level || 0;
    stats.total += damage;
    stats.max = Math.max(stats.max, damage);
    stats.min = Math.min(stats.min, damage);
    return stats;
  }, { total: 0, max: 0, min: 100 });
  
  damageStats.average = damageStats.total / features.length;
  
  // استخراج إحصائيات حول الكثافة السكانية
  const densityStats = features.reduce((stats, feature) => {
    const density = feature.properties.population_density || 0;
    stats.total += density;
    stats.max = Math.max(stats.max, density);
    stats.min = Math.min(stats.min, density);
    return stats;
  }, { total: 0, max: 0, min: 10000 });
  
  densityStats.average = densityStats.total / features.length;
  
  // استخراج إحصائيات حول الأولوية
  const priorityStats = features.reduce((stats, feature) => {
    const priority = feature.properties.priority || 0;
    stats.total += priority;
    stats.max = Math.max(stats.max, priority);
    stats.min = Math.min(stats.min, priority);
    return stats;
  }, { total: 0, max: 0, min: 6 });
  
  priorityStats.average = priorityStats.total / features.length;
  
  // تحليل بحسب القطاع
  const sectorAnalysis = {};
  features.forEach(feature => {
    const sector = feature.properties.Sector_01 || 'غير محدد';
    if (!sectorAnalysis[sector]) {
      sectorAnalysis[sector] = {
        count: 0,
        totalDamage: 0,
        totalDensity: 0,
        totalPriority: 0,
        totalArea: 0
      };
    }
    
    sectorAnalysis[sector].count++;
    sectorAnalysis[sector].totalDamage += feature.properties.damage_level || 0;
    sectorAnalysis[sector].totalDensity += feature.properties.population_density || 0;
    sectorAnalysis[sector].totalPriority += feature.properties.priority || 0;
    sectorAnalysis[sector].totalArea += feature.properties.Shape_Area || 0;
  });
  
  // حساب المتوسطات لكل قطاع
  Object.keys(sectorAnalysis).forEach(sector => {
    const stats = sectorAnalysis[sector];
    stats.avgDamage = stats.totalDamage / stats.count;
    stats.avgDensity = stats.totalDensity / stats.count;
    stats.avgPriority = stats.totalPriority / stats.count;
    stats.avgArea = stats.totalArea / stats.count;
    stats.populationEstimate = Math.round((stats.avgDensity * stats.totalArea) / 1000000);
  });
  
  return {
    damageStats,
    densityStats,
    priorityStats,
    sectorAnalysis
  };
}

// كشف عن أفضل المواقع للتدخل الإنساني والخدمات
function getOptimalLocations(data) {
  const features = data.features;
  
  // ترتيب الأحياء حسب أولوية التدخل والكثافة السكانية والتضرر
  return features.map(feature => {
    const id = feature.properties.ID;
    const name = feature.properties.Names;
    const sector = feature.properties.Sector_01 || 'غير محدد';
    const damage = feature.properties.damage_level || 0;
    const density = feature.properties.population_density || 0;
    const priority = feature.properties.priority || 0;
    
    // حساب مؤشر مركب للأولوية (يمكن تعديل الصيغة حسب الحاجة)
    const interventionScore = (damage * 0.4) + (density / 1000 * 0.3) + (priority * 0.3);
    
    return {
      id,
      name,
      sector,
      damage,
      density,
      priority,
      interventionScore
    };
  }).sort((a, b) => b.interventionScore - a.interventionScore);
}